import React from "react";
import Header from './components/Header';
import SubHeader from "./components/SubHeader";
import Form from "./components/Form";

function App(){
  return(
     <>
     <Header/>
     <SubHeader/>
     <Container></Container>
     <div className="row">
       <div className="col">
         <Form />
       </div>
       </div>
     </>
  );
}

export default App;
